import React from 'react';
import { Row, Col, Card } from 'antd';

const Home = () => {
    return (
        <div >
            <Row>
                <Col span={7}>
                    <Card bordered={false}>
                        asdf
                    </Card>
                </Col>
                <Col span={17}>
                    <Card bordered={false}>
                        qwer
                    </Card>
                </Col>
            </Row>
        </div>
    )
};

export default Home;
